import React from 'react';
import { View, Text, StyleSheet } from 'react-native';

const LocationHeader = () => {
    return (
        <View style={styles.location_Header}>
            <View style={styles.location_Header_box}>
                <Text style={styles.l_left}>Left</Text>
                <Text style={styles.l_middle}>Middle</Text>
                <Text style={styles.l_right}>Right</Text>
            </View>
        </View>
    );
}

const styles = StyleSheet.create({
    location_Header: {
        position: 'absolute',
        width: '100vw',
        height: "115px",
        left: 0,
        right: 0,
        backgroundColor: '#175C4C',
        borderBottomLeftRadius: '20px',

    },
    location_Header_box: {
        flex: '1',
        flexDirection: 'row',
        padding: 20,


    },
    l_left: {
        width: "29px",
        height: "12px",
        backgroundColor: "#fff"
    },
    l_middle: {

        width: "212px",
        height: "123px",
        left: '82px',
        top: '-152px',
        opacity: '0.5px',
        borderWidth: '1px',
        borderColor: "#C0E1BF"
    },
    l_right: {}
})

export default LocationHeader;
